import React from 'react'

import './projects.css'


const Projects = () => {

    const projects = [
        "Test 1",
        "Test 2",
        "Test 3",
        "Test 4",
        "Test 5",
    ]

    return (
        <div className="project-box">
            <ol>
                {projects.map((project) => (
                    <li>{project}</li>
                ))}
            </ol>
        </div>
    )
}

export default Projects
